import React, {Component} from 'react';
import axios from 'axios';

class Blog extends Component{
  componentDidMount(){
    axios.get("https://jsonplaceholder.typicode.com/users")
    .then(res => {
      console.log(res.data);
    })
  }
  render(){
    return (
      <div>
          <h3>Presentation</h3>
          <p> react_router-dom vous permis de construire les route et la redirection dans ReactJS il faut l'installer avec la commande<br/> npm i react-router-dom</p>
      </div>
    )
  }
}
export default Blog;
